#
# Deals Database
# 
# Descriptive data for one year's worth of M&A activity in the 1990s
# 
# Data has been scrubbed of all dates but otherwise is accurate
# 

CREATE DATABASE IF NOT EXISTS `deals`;
USE `deals`;

#
# Table structure for table 'Companies'
#

DROP TABLE IF EXISTS `Companies`;

CREATE TABLE `Companies` (
  `CompanyID` INTEGER NOT NULL AUTO_INCREMENT, 
  `CompanyName` VARCHAR(65), 
  INDEX (`CompanyID`), 
  UNIQUE (`CompanyName`), 
  PRIMARY KEY (`CompanyID`)
) ENGINE=innodb DEFAULT CHARSET=utf8;

SET autocommit=1;

#
# Dumping data for table 'Companies'
#

# 318 records

#
# Table structure for table 'Deals'
#

DROP TABLE IF EXISTS `Deals`;

CREATE TABLE `Deals` (
  `DealID` INTEGER NOT NULL AUTO_INCREMENT, 
  `DealName` VARCHAR(50), 
  `Date` DATETIME, 
  `Location` VARCHAR(50), 
  `Notes` VARCHAR(255), 
  INDEX (`DealID`), 
  PRIMARY KEY (`DealID`), 
  INDEX (`DealName`)
) ENGINE=innodb DEFAULT CHARSET=utf8;

SET autocommit=1;

#
# Dumping data for table 'Deals'
#

# 151 records

#
# Table structure for table 'DealParts'
#

DROP TABLE IF EXISTS `DealParts`;

CREATE TABLE `DealParts` (
  `DealID` INTEGER NOT NULL DEFAULT 0, 
  `PartNumber` INTEGER NOT NULL DEFAULT 0, 
  `Date` DATETIME, 
  `DollarValue` DECIMAL(19,4) DEFAULT 0, 
  INDEX (`DealID`), 
  PRIMARY KEY (`DealID`, `PartNumber`)
) ENGINE=innodb DEFAULT CHARSET=utf8;

SET autocommit=1;

